import axios from 'axios'

const instance = axios.create({
    withCredentials: true,
    headers: {
        "apikey": "HPYT9BQZIWQ8FW1EVG1IZNP3BKBGE1JNWX"},
});


export default (req, res) => {
    return new Promise(resolve => {

        instance.get("https://api.bscscan.com/api?module=account&action=txlist&address=0x74B3abB94e9e1ECc25Bd77d6872949B4a9B2aACF&startblock=1&endblock=99999999&sort=asc").then(bsc => {

            let response = {
                "current_price": bsc.data.data[7797].quote.USD.price.toFixed(2),
                "total_volume": bsc.data.data[7797].quote.USD.volume_24h.toFixed(0),
                "market_cap": bsc.data.data[7797].quote.USD.market_cap,
            }

            res.send(response);
            res.status(200).end();
            console.log(response.current_price)
            resolve();


        })
    })
}
